measurements.description:
One well-presented flower on one inflorescence; dorsal sepal light green overlaid with dark green and maroon mosaic pattern;
	synsepal light green fading to rose to cream distally, overlaid with reticulation dark green fading to maroon distally;
	petals tiny and pale yellow with maroon apex; lip hinged, light green overlaid with maroon spots; anther cap yellow;
    substance firm; texture crystalline.
